  true,\n\t\"url\": null,\n\t\"notes\": \"Annual average wind resource potential for
  the state of Oklahoma at a 50 meter height.rnrnThis data set has been validated
  by NREL and wind energy meteorological consultants. *Note:* This data is not suitable
  for micro-siting potential development projects. This shapefile was generated from
  a raster dataset with a 200 m resolution, in a UTM zone 12, datum WGS 84 projection
  system.rnrnThe wind power resource estimates were produced by AWS TrueWind using
  their MesoMap system and historical weather data under contract to Wind Powering
  America/NREL. This map has been validated with available surface data by NREL and
  wind energy meteorological consultants.rn\",\n\t\"license_title\": \"Creative Commons
